import React,{ useState } from 'react'
import { GlobalStyle } from './styles/GlobalStyle'
import ToDo from './components/organisms/ToDo'
import createStore from 'redux'

const count = 0;

const countUp = (state = {count}, action) => {
  switch(action.type) {
    case 'UP':
      return state + 1
    case 'DOWN':
      return state - 1
    default:
      return state
  }
}

const store = Redux.createStore(countUp);



const App = () => {
  return (
    <div>
      <GlobalStyle />
      <h1>{count}</h1>
      <button>+</button>
      <button>-</button>
    </div>
  );
};



export default App;
